import { Routes, Route } from "react-router-dom";

//Import Routes

import { HomePage, ContentsPage } from "../views/index";

const RoutesPag = () => {
    return (
        <Routes>
            {/* Home */}
            <Route path="/" element={<HomePage />} />;
            {/* ======================= Contents ========================== */}
            <Route path="/contents/" element={<ContentsPage course="contents" path={console.log(value.pathname)}/>} />
            {/* ======================= Computing ========================== */}
            <Route
                path="/contents/computing"
                element={<ContentsPage course="/contents/computing" />}
            />
            {/* ======================= Programming ========================== */}
            <Route
                path="*"
                element={<h1>ERROR 404 No se encuentra el documento</h1>}
            />
        </Routes>
    );
};

export { RoutesPag as PagApp };
